#if USE_ALPHA_TEST
  layout(set = 1, binding = 1) uniform ALPHA_TEST_DATA {
    float alphaThreshold;
  };
#endif
void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
    if (color.a < alphaThreshold) discard;
  #endif
}
void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
    if (alpha < alphaThreshold) discard;
  #endif
}
layout(location = 0) in vec4 color;
layout(location = 1) in vec2 uv0;
layout(set = 2, binding = 11) uniform sampler2D cc_spriteTexture;
layout(set = 1, binding = 2) uniform RATE{
    vec2 uVScrollSpeed;
    float timeScale;
};
vec4 frag () {
  float tscale = cc_time.x * timeScale;
  vec2 uvscale = uv0 * vec2( 1,1 ) + vec2( 0,0 );
  vec4 c = texture(cc_spriteTexture, mod(uVScrollSpeed * tscale  + uvscale ,vec2( 1,1 ) ) ) * color;
  c.rgb *= c.a;
  ALPHA_TEST(c);
  return c;
}
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }

